  false,\n\t\"url\": null,\n\t\"notes\": \"Physical and chemical oceanographic observational
  data collected by bottle and CTD in the Gulf of Mexico from the R/V Gyre and R/V
  Pelican, April 2004 - July 2009. Data were submitted from the project Mechanisms
  Controlling Hypoxia on the Louisiana Shelf. This data are part of a comprehensive
  and multidisciplinary study of the Texas-Louisiana Shelf that included interdisciplinary
  process cruises and shelf-wide surveys to complement, and provide rates and other
  parameters necessary for the initiation, control, and skill assessment of a realistic
  coupled three-dimensional hydrodyamic-biological-geochemical-sediment numerical
  modeling and statistical (multivariate) modeling elements.\",\n\t\"owner_org\":
